import React from "react";
import AppBar from "@mui/material/AppBar";
import ToolBar from "@mui/material/Toolbar";

const Header = (props) => {
  return (
    <AppBar position="fixed">
      <ToolBar> Header project</ToolBar>
    </AppBar>
  );
};

export default Header;
